package classworks2;

public class Printnextpattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = 4;
		 int num1 = 10;
		 for (int i = 1; i <= num; i++) {
			 for (int j = 1; j <= num1; j++) {
				 System.out.print("*");
			 }
			 
			 System.out.println();
		 }
	            

	}

}
